import React, { useState } from "react";
import { BrowserRouter as Router, Route, Routes, Navigate } from "react-router-dom";
import PublicMapView from "./PublicMapView";
import OfficeDashboard from "./OfficeDashboard";

const App = () => {
  const [loggedInOffice, setLoggedInOffice] = useState(null);

  const handleLogin = (officeData) => {
    console.log("âœ… Office logged in:", officeData);
    setLoggedInOffice(officeData);
  };

  const handleLogout = () => {
    console.log("ðŸ”´ Office logged out");
    setLoggedInOffice(null);
  };

  return (
    <Router>
      <Routes>
        {/* Public Map View */}
        <Route
          path="/"
          element={
            <PublicMapView
              loggedInOffice={loggedInOffice}
              navigateToDashboard={() => window.location.href = "/dashboard"}
            />
          }
        />

        {/* Office Dashboard (Only if logged in) */}
        <Route
          path="/dashboard"
          element={
            loggedInOffice ? (
              <OfficeDashboard office={loggedInOffice} onLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )
          }
        />
      </Routes>
    </Router>
  );
};

export default App;
